#include <gtest/gtest.h>
#include <string>
#include <sstream>
#include <vector>
#include <math.h>

using namespace std;

string removeDuplicates(string s)
{
    char* chars;
    chars = s.data();
    int n = s.length();
    
    int left = 0;
    int right = 1;
    while (right < n)
    {
        if (chars[left] == chars[right])
        {
            chars[left--] = -1;
            chars[right++] = -1;
            while (left >= 0 && chars[left] < 0)
            {
                left--;
            }
            if (left < 0)
            {
                if (chars[right-1] > 0)
                {
                    left = right - 1;
                }
                else
                {
                    right++;
                    left = right - 1;
                }
            }
        }
        else if (right - left > 1)
        {
            if (chars[right-1] > 0)
            {
                left = right-1;
            }
            else
            {
                right++;
                left = right -1;
            }
        }
        else
        {
            right++;
            left++;
        }
    }

    stringstream ss;
    for (int i=0;i<n;i++)
    {
        char x = chars[i];
        if (x > 0)
        {
            ss << (char)(x);
        }
    }
    return ss.str();
}


TEST(Example, Example1)
{
    EXPECT_EQ("", removeDuplicates(""));
    EXPECT_EQ("a", removeDuplicates("a"));
    EXPECT_EQ("", removeDuplicates("aa"));
    EXPECT_EQ("", removeDuplicates("axxa"));
    EXPECT_EQ("a", removeDuplicates("aaaaa"));
    EXPECT_EQ("a", removeDuplicates("aaaaaaa"));
    EXPECT_EQ("a", removeDuplicates("aaaaaaaaa"));
}

TEST(Example, Example2)
{
    EXPECT_EQ("", removeDuplicates(""));
    EXPECT_EQ("a", removeDuplicates("a"));
    EXPECT_EQ("bx", removeDuplicates("aabxbbaa"));
    EXPECT_EQ("b", removeDuplicates("aabbbaa"));
    EXPECT_EQ("ba", removeDuplicates("aabbbaaa"));
}

TEST(Example, LimitExample1)
{
    stringstream ss;
    for (int i = 0; i < pow(10,5); i++)
    {
        ss << 'a';
    }

    EXPECT_EQ("", removeDuplicates(ss.str()));
}

TEST(Example, LimitExample2)
{
    stringstream ss;
    for (int i = 0; i < pow(10,5); i++)
    {
        ss << (char)('a' + (i%23));
    }
    string s = ss.str();
    EXPECT_EQ(s, removeDuplicates(s));
}

TEST(Example, LimitExample3)
{
    string s = "";
    EXPECT_EQ("", removeDuplicates(s));
}

int main(int argc, char **argv)
{
    testing::InitGoogleTest(&argc, argv);
    return RUN_ALL_TESTS();
}